import React, { Component } from "react";
import ReactGA from "react-ga";
import $ from "jquery";
import "./App.css";
import Cabecalho from "./Components/Cabecalho";
import Rodape from "./Components/Rodape";
import Resumo from "./Components/Resumo";
import Contato from "./Components/Contato"

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      foo: "barras",
      resumoStats: {}
    };

    ReactGA.initialize("UA-110570651-1");
    ReactGA.pageview(window.location.pathname);
  }

  getresumoStats() {
    $.ajax({
      url: "./resumoStats.json",
      dataType: "json",
      cache: false,
      success: function(data) {
        this.setState({ resumoStats: data });
      }.bind(this),
    });
  }

  componentDidMount() {
    this.getresumoStats();
  }

  render() {
    return (
      <div className="App">
        <Cabecalho data={this.state.resumoStats.main} />

        <Contato data={this.state.resumoStats.main} />
        <Rodape data={this.state.resumoStats.main} />
      </div>
    );
  }
}

export default App;
